        public UberstateEditor(WOTWCombination WOTWCombination, List<UberState> uberstates) {
            InitializeComponent();
            this.AddContent(uberstates);
            this.WOTWCombination = WOTWCombination;
            //this.ReadWrite();
        }

        private void newUberEditor_Click(object sender, EventArgs e) {
            UberInput uberInput = new UberInput();
            this.UberInputs.Add(uberInput);
            this.uberStateList.Controls.Add(uberInput);

            if (this.UberInputs.Count >= 16) {
                this.uberStateList.AutoScroll = true;
            } else {
                this.uberStateList.AutoScroll = false;
            }
        }

        private void AddContent(List<UberState> uberstates) {
            this.uberStateList.SuspendLayout();
            foreach (UberState uber in uberstates) {
                UberInput uberInput = new UberInput();
                uberInput.ChangeUberGroup(uber.GroupName);
                uberInput.GenerateUberList();
                uberInput.ChangeUber(uber.Name);
                uberInput.SetValue(uber.Value, uber.Type);
                this.UberInputs.Add(uberInput);
                this.uberStateList.Controls.Add(uberInput);
            }
            if (this.UberInputs.Count >= 16) {
                this.uberStateList.AutoScroll = true;
            } else {
                this.uberStateList.AutoScroll = false;
            }
            this.uberStateList.ResumeLayout(false);
            this.uberStateList.PerformLayout();
        }

        public void RemoveUberstate(UberInput uberInput) {
            this.UberInputs.Remove(uberInput);
            this.uberStateList.Controls.Remove(uberInput);
        }

        private void cancel_Click(object sender, EventArgs e) {
            this.Dispose();
        }

        private void save_Click(object sender, EventArgs e) {
            List<UberState> uberStates = new List<UberState>();

            foreach (UberInput uber in this.uberStateList.Controls) {
                string Type = "bool";

                if (uber.uberIdValueBool.Visible == true) {
                    Type = "bool";
                } else if (uber.uberIdValueByte.Visible == true) {
                    Type = "byte";
                } else if (uber.uberIdValueFloat.Visible == true) {
                    Type = "float";
                } else if (uber.uberIdValueInt.Visible == true) {
                    Type = "int";
                }


                UberIDGroup uberIDGroup = uber.GetUberIDGroup(uber.uberGroupId.SelectedItem.ToString());
                UberID uberId = uberIDGroup.UberIDs[uber.uberId.SelectedItem.ToString()];

                UberState newUber = new UberState() { Name = uberId.Name, ID = uberId.ID, GroupName = uberIDGroup.Name, GroupID = uberIDGroup.GroupID, Type = UberStateType.SerializedBooleanUberState };

                switch (Type) {
                    case "bool":
                        newUber = new UberState() { Name = uberId.Name, ID = uberId.ID, GroupName = uberIDGroup.Name, GroupID = uberIDGroup.GroupID, Type = UberStateType.SerializedBooleanUberState };
                        newUber.Value.Bool = uber.uberIdValueBool.Checked;
                        break;

                    case "float":
                        newUber = new UberState() { Name = uberId.Name, ID = uberId.ID, GroupName = uberIDGroup.Name, GroupID = uberIDGroup.GroupID, Type = UberStateType.SerializedFloatUberState };
                        newUber.Value.Float = (float)uber.uberIdValueFloat.Value;
                        break;

                    case "int":
                        newUber = new UberState() { Name = uberId.Name, ID = uberId.ID, GroupName = uberIDGroup.Name, GroupID = uberIDGroup.GroupID, Type = UberStateType.SerializedIntUberState };
                        try {
                            newUber.Value.Int = (int)uber.uberIdValueInt.Value;
                        } catch {
                            newUber.Value.Int = 0;
                        }
                        break;

                    case "byte":
                        newUber = new UberState() { Name = uberId.Name, ID = uberId.ID, GroupName = uberIDGroup.Name, GroupID = uberIDGroup.GroupID, Type = UberStateType.SerializedByteUberState };
                        try {
                            newUber.Value.Byte = (byte)uber.uberIdValueByte.Value;
                        } catch {
                            newUber.Value.Byte = 0;
                        }
                        break;
                }

                uberStates.Add(newUber);
            }

            this.WOTWCombination.UpdateUberstates(uberStates);
            this.Dispose();
        }

