        private void storeUberstates_Click(object sender, EventArgs e) {
            Manager manager = this.WOTWCombination.GetParent().GetForm() as Manager;

            if (manager != null) {
                foreach (KeyValuePair<string, UberIDGroupT> uberIdGroup in this.UberStatesComparison) {
                    foreach (KeyValuePair<string, UberState> uber in uberIdGroup.Value.UberIDs) {
                        manager.Memory.UpdateUberState(uber.Value);
                    }
                }
            }
        }

        private void compareUberstates_Click(object sender, EventArgs e) {
            Manager manager = this.WOTWCombination.GetParent().GetForm() as Manager;
            List<UberState> compares = new List<UberState>();

            if (manager != null) {
                foreach (KeyValuePair<string, UberIDGroupT> uberIdGroup in this.UberStatesCompare) {
                    foreach (KeyValuePair<string, UberState> uber in uberIdGroup.Value.UberIDs) {
                        manager.Memory.UpdateUberState(uber.Value);
                    }
                }

                foreach (KeyValuePair<string, UberIDGroupT> uberIdGroup in this.UberStatesCompare) {
                    foreach (KeyValuePair<string, UberState> uber in uberIdGroup.Value.UberIDs) {
                        switch (uber.Value.Type) {
                            case UberStateType.SerializedBooleanUberState:
                                if (uber.Value.Value.Bool != this.UberStatesComparison[uberIdGroup.Key].UberIDs[uber.Key].Value.Bool) {
                                    compares.Add(uber.Value);
                                }
                                break;

                            case UberStateType.SerializedByteUberState:
                                if (uber.Value.Value.Byte != this.UberStatesComparison[uberIdGroup.Key].UberIDs[uber.Key].Value.Byte) {
                                    compares.Add(uber.Value);
                                }
                                break;

                            case UberStateType.SerializedFloatUberState:
                                if (uber.Value.Value.Float != this.UberStatesComparison[uberIdGroup.Key].UberIDs[uber.Key].Value.Float) {
                                    compares.Add(uber.Value);
                                }
                                break;

                            case UberStateType.SerializedIntUberState:
                                if (uber.Value.Value.Int != this.UberStatesComparison[uberIdGroup.Key].UberIDs[uber.Key].Value.Int) {
                                    compares.Add(uber.Value);
                                }
                                break;
                        }
                    }
                }
            }
            this.AddContent(compares);
        }
    }

    public class UberIDGroupT {
        public Dictionary<string, UberState> UberIDs = new Dictionary<string, UberState>();
        public string Name = "Default";
        public int GroupID = 0;

        public UberIDGroupT(Dictionary<string, UberState> uberids, string name, int groupId) {
            this.UberIDs = uberids;
            this.Name = name;
            this.GroupID = groupId;
        }
    }
